import React from 'react';

function TopArtists({ artists }) {
  return (
    <div className="top-artists">
      <h2>Your Top Artists</h2>
      <ul>
        {artists.map((artist, index) => (
          <li key={index}>{artist}</li>
        ))}
      </ul>
    </div>
  );
}

export default TopArtists;
